import React from 'react'
import {Link} from 'react-router-dom'

export default class Projects extends React.Component{

    render(){
        return(
            <div>
                <Link to='/addproject'><button>Add Project</button></Link>
                <br/>
                <ul>
                    <li>
                        <p>Project Name: </p>
                        <p>Project Description: </p>
                    </li>
                </ul>
            </div>
        )
    }
}
